var timeSum = 28790; var moneysum = timeSum.toLocaleString(); 
var tallage = 3;
var result = timeSum / 100 * tallage; //вычисление процентов
var percentm = result.toLocaleString(); 
var raznpercent = timeSum - result;
var ostpercent = raznpercent.toLocaleString(); 
setTimeout(function(){$("#moneysum1,#moneysum2,#moneysum3,#moneysum4,#moneysum5,#moneysum14").text(moneysum); $("#moneysum6,#moneysum7").text(percentm); $("#moneysum8,#moneysum9,#moneysum10,#moneysum11,#moneysum12,#moneysum13,#moneysum15").text(ostpercent);},1);

